import "./Navbar.css";

// Components
import { NavLink, Link } from "react-router-dom";
import {
	BsSearch,
	BsHouseDoorFill,
	BsFillPersonFill,
	BsFillCameraFill,
} from "react-icons/bs";

const Navbar = () => {
	return (
		<div>
			<nav id="nav">
				<Link to="/">Lendas do Roblox</Link>
				<form id="search-form">
					<BsSearch />
					<input type="text" placeholder="Buscar" />
				</form>
				<ul id="nav-links">
					<li>
						<NavLink to="/">
							<BsHouseDoorFill />
						</NavLink>
					</li>
					<li>
						<NavLink to="/login">Entrar</NavLink>
					</li>
					<li>
						<NavLink to="/register">Registar</NavLink>
					</li>
				</ul>
			</nav>
		</div>
	);
};

export default Navbar;
